import React from 'react';
import temple from '../img/temple.png'

const style = {
    color: '#ffffff',
    backgroundColor: '#000000',
    backgroundImage: 'url(${temple})',
    backgroundSize: '50%',
    minWidth: '20%',
    minHeight: '1000px',
};

export default function Home() {
    return (
        <div style={style}>
            My First React Component!
        </div>
    );
}
